import React from "react";
import Navbar from "../components/Navbar";
import neew from "../components/neew";

function Page(props) {
  return (
    <div>
      <Navbar sign={props.sign}></Navbar>
      <div>
        <neew ad="buket"></neew>
      </div>
    </div>
  );
}

export default Page;
